import React from 'react';
import { PieChart, Pie, Cell, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { useModal } from '../../context/ModalContext';
import InsightCard from '../insight/InsightCard';
import { useAuth } from '../../context/AuthContext';

const COLORS = [
  '#0088FE', '#00C49F', '#FFBB28', '#FF8042',
  '#0660FE', '#00D19F', '#FFBC28', '#FF8422',
  '#0057FE', '#20C49F', '#FFAA28', '#FF8412'
];

function Expense({ data }) {
  const { auth } = useAuth();
  const { showModal } = useModal();

  if (!data) return null;

  const chartData = [
    { name: 'Food', value: data.Food || 0 },
    { name: 'Shelter', value: data.Shelter || 0 },
    { name: 'Gas', value: data.Gas || 0 },
    { name: 'Bike', value: data.Bike || 0 },
    { name: 'Stationary', value: data.Stationary || 0 },
    { name: 'Smoke', value: data.Smoke || 0 },
    { name: 'Shopping', value: data.Shopping || 0 },
    { name: 'Wine', value: data.Wine || 0 },
    { name: 'Washing', value: data.Washing || 0 },
    { name: 'Medicine', value: data.Medicine || 0 },
    { name: 'Jio', value: data.Jio || 0 },
    { name: 'Misc', value: data.Misc || 0 },
  ].filter(entry => entry.value > 0); // filter out 0s for clarity

  const totalExpense = data.TOTAL || 0;

  return (
    <>
      <div style={{ display: 'flex', justifyContent: 'space-between', gap: '2rem', flexWrap: 'wrap',  }} style={{ flex: '1', }}>

        {/* Expense Table */}
        <div style={{ flex: 1 }}>
          <h3 style={{ marginBottom: '0.5rem' }}>Expense Breakdown</h3>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr>
                <th style={{ borderBottom: '1px solid #ccc', padding: '8px', textAlign: 'left' }}>Category</th>
                <th style={{ borderBottom: '1px solid #ccc', padding: '8px', textAlign: 'right' }}>Amount (â‚¹)</th>
              </tr>
            </thead>
            <tbody>
              {chartData.map((entry, index) => (
                <tr key={index}>
                  <td style={{ padding: '8px' }}>{entry.name}</td>
                  <td style={{ padding: '8px', textAlign: 'right' }}>{entry.value}</td>
                </tr>
              ))}
              <tr style={{ fontWeight: 'bold', borderTop: '2px solid #ccc' }}>
                <td style={{ padding: '8px' }}>Total</td>
                <td style={{ padding: '8px', textAlign: 'right' }}>{totalExpense}</td>
              </tr>
              
    
            </tbody>
          </table>
        </div>

        {/* Pie Chart */}
        <div style={{ flex: 1, minWidth: '300px', height: 300 }}>
          <ResponsiveContainer>
            <PieChart>
              <Pie
                data={chartData}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={100}
                fill="#8884d8"
                label
              >
                {chartData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>

      </div>
    </>
  );
}

export default Expense;
